import styled from "styled-components";

export const Wrap = styled.header`
position: fi
  display: flex;
  align-items: center;
  justify-content: center;
  height: 80px;
  background-color: #fff;
  padding: 10px 163px;
  width: 100%;
`;

export const Container = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  max-width: 1594px;
  width: 100%;
`;
